    return (
        <div className="tour-item">
                <Panel header="Tournaments">
                   <p>{tournamentsList[0].map(tournament => 
                     // Tle renderi TournamentItem componento k jo bos enkrat naredu. pac poslji ji prope, ki jih rabi i caoo 
